import NavBar from './NavBar';
const Intro = ()=>{
return (
    <div id="container">
       <NavBar></NavBar>
       <div class="intro-card">
        <div>
            <img src='../images/girl.png'></img>
        </div>
       </div>
    </div>
)
}


export default Intro;
